import { withAuthenticator } from "@aws-amplify/ui-react";
import "@aws-amplify/ui-react/styles.css";
import { useState } from "react";
import { Auth, API, Amplify } from "aws-amplify";
import config from "./../aws-exports.js";
Auth.configure(config);

async function callApiDynamo(filename, date) {
  console.log("PRINTING EVENT");
  const user = await Auth.currentAuthenticatedUser();
  const token = user.signInUserSession.idToken.jwtToken;
  console.log("Filename: ", filename);
  console.log("Date: ", date);
  console.log("token: ", token);

  const requestData = {
    headers: {
      Authorization: "Bearer " + token,
    },
    /*
    queryStringParameters: {
      requested_filename: filename,
      upload_date: date,
    },
    */
  };
  console.log(requestData);
  try {
    const data = await API.get("phibyeapi", "/pulldata", requestData);
    console.log("data: ", data);
  } catch (error) {
    console.log(error);
  }
}

function MyForm() {
  const [filename, setfileName] = useState("");
  const [date, setDate] = useState("");
  const handleSubmit = (event) => {
    event.preventDefault();
    //alert(`Name inputted: ${filename}\nDate inputted: ${date}`);
    callApiDynamo(filename, date);
  };
  return (
    <div>
      <h1>File Lookup Page</h1>
      <form onSubmit={handleSubmit}>
        <div class="input-group">
          <label class="dialog-box">
            Enter Filename:
            <input
              class="input"
              type="text"
              value={filename}
              onChange={(e) => setfileName(e.target.value)}
            />
          </label>
          <br></br>
          <label class="dialog-box">
            Enter Date:
            <input
              class="input"
              type="Date"
              value={date}
              onChange={(e) => setDate(e.target.value)}
            />
          </label>
        </div>
        <br></br>
        <input claas="submit-btn" type="submit" />
      </form>
    </div>
    /*
    <div>
      <form name="queryfileform" onSubmit={handlesubmit}>
        <label for="filename">Filename</label>
        <input type="text" id="filename" name="requested_filename"></input>
        <br></br>
        <label for="date">Filename</label>
        <input type="Date" id="date" name="upload_date"></input>
        <button type="submit">Submit</button>
      </form>
    </div>*/
  );
}

/*
document.getElementById("queryButton").addEventListener("click", () => {
  console.log("CLICK!");
});
*/
export default withAuthenticator(MyForm);
